    false,nt"url": null,nt"notes": "This narrative report for Lake Bowdoin
    NWR outlines Refuge accomplishments from August through October of 1941. The report
    begins by summarizing the weather conditions, water conditions, and food and cover
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, fish, and disease- is also covered. The Refuge development
    and maintenance section discusses physical developments and collections and receipts.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    and violations. N-R forms, photographs, an update on the easement refuges, and newspaper
    articles are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
